import render from "./render";

const zip = (xs, ys) => {
  const zipped = [];
  for (let i = 0; i < Math.min(xs.length, ys.length); i++){
    zipped.push([xs[i], ys[i]]);
  }
  return zipped;
}

const diffChildren = (oldVChildren, newVChildren) => {
  const childPatches = []
  for (const [oldVChild, newVChild] of zip(oldVChildren, newVChildren)){
    childPatches.push(diff(oldVChild, newVChild)); 
  }

  const additionalPatches = [];
  for (const additionalVChild of newVChildren.slice(oldVChildren.length)){
    additionalPatches.push($node => {
      $node.appendChild(render(additionalVChild));
      return $node;
    });

  }

  return $parent => {
    for (const [patch, child] of zip(childPatches, $parent.childNodes)) {
      patch(child);
    } 
    for (const patch of additionalPatches) {
      patch($parent);
    }
    return $parent;
  }
}

const diffAttribute = (oldAttrs, newAttrs) => {
  const patches = []

  // Set New Attributes
  for (const [key, value] of Object.entries(newAttrs)) {
    patches.push($node => {
      $node.setAttribute(key, value);
      return $node;
    });
  }

  for (const key in oldAttrs) {
    if (!(key in newAttrs)){
      patches.push($node => {
        $node.removeAttribute(key);
        return $node;
      });
    }
  }

  return $node => {
    for (const patch of patches) {
      patch($node);
    }
  };
};

const diff = (vOldNode, vNewNode) => {
  if (vNewNode === undefined){
    return $node => {
      $node.remove();
      return undefined;
    }
  }

  if (typeof vOldNode === 'string' || 
    typeof vNewNode === 'string') {
    if (vOldNode !== vNewNode) {
      return $node => {
        const $newNode = render(vNewNode);
        $node.replaceWith($newNode);
        return $newNode;
      }
    } else {
      return $node => undefined;
    }
  }

  if (vOldNode.tagName !== vNewNode.tagName){ 
    return $node => {
      const $newNode = render(vNewNode);
      $node.replaceWith($newNode);
      return $newNode;
    } 
  }

  const patchAttributes = diffAttribute(vOldNode.attrs, vNewNode.attrs);
  const patchChildren = diffChildren(vOldNode.children, vNewNode.children);


  return $node => {
    patchAttributes($node);
    patchChildren($node);
    return $node;
  };
}

export default diff;
